import React from 'react';

const Navbar = () => {
  return (
    <nav style={navStyle}>
      <div style={centerStyle}>
        <h1 style={titleStyle}>Wathare Infotech Solutions</h1>
      </div>
    </nav>
  );
};

// Styles
const navStyle = {
  backgroundColor: '#f0f0f0',
  padding: '10px 0',
};

const centerStyle = {
  textAlign: 'center',
};

const titleStyle = {
  fontWeight: 'bold',
  color: 'skyblue',
};

export default Navbar;
